					padding: 0px;
				}

					color: #fff;

					margin-bottom: 40px;
				}

					width: 60%;
				}
				.right {
					width: 35%;
				}
				.analysis {
					background-color: #DDDDEE;
				}
				a, a:visited {
					color: #bb22bb;
					text-decoration: none;
				}
				a:hover {
					color: #d3832d;
				    text-decoration: underline;
				}
				#map { 
					width:100%; 
					height:440px;
				}
			</style>
